import {
  Avatar,
  Container,
  Flex,
  Stack,
  Autocomplete,
  Box,
  Button,
} from "@mantine/core";
import React, { useState } from "react";
import {
  IconAlignLeft,
  IconSearch,
  IconCircleXFilled,
  IconBell,
} from "@tabler/icons-react";
const AppBar = () => {
  const [isSelected, setIsSelected] = useState(false);

  const handleContainerClick = () => {
    setIsSelected(!isSelected);
  };

  return (
    // <Stack
    //   mih={50}
    //   bg="rgba(0, 0, 0, .3)"
    //   gap="md"
    //   justify="center"
    //   align="center"
