    //     style={{
    //       borderRadius: "5px",
    //       display: "flex",
    //       alignItems: "center",
    //       justifyContent: "space-between",
    //       width: "100%",
    //       height: "40px",
    //     }}
    //   >
    //     <div style={{ display: "inline-block", justifyContent: "center" }}>
    //       App Bars
    //     </div>
    //     <div style={{ display: "flex", justifyContent: "flex-end" }}>
    //       <IconCircleXFilled color="red" />
    //     </div>
    //   </Container>

    //   <Stack
    //     m="xs"
    //     bg="var(--mantine-color-white)"
    //     style={{ display: "flex", alignItems: "center", width: "100%" }}
    //   >
    //     <Flex mih={50} gap="md" justify="space-between" align="center">
    //       <div style={{ flex: 1 }}>
    //         <IconAlignLeft style={{ marginLeft: "4px" }} />
    //       </div>
    //       <div
    //         style={{
    //           display: "flex",
    //           alignItems: "center",
    //           gap: "md",
    //           marginRight: "4px",
    //         }}
    //       >
    //         <IconSearch />
    //         <Avatar
    //           variant="filled"
    //           radius="sm"
    //           src="https://images.unsplash.com/photo-1535713875002-d1d0cf377fde?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=250&q=80"
    //         />
    //       </div>
    //     </Flex>
    //   </Stack>

    //   <Button mb="xs">Button 3</Button>
    // </Stack>
    <div>
      <Box bg="rgba(245,245,245)" my="xl">
        <Container
          fluid
          bg="var(--mantine-color-blue-light)"
          style={{
            borderRadius: "5px",
            display: "flex",
            alignItems: "center",
            justifyContent: "space-between",
          }}
        >
          <div
            style={{ display: "inline-block", justifyContent: "flex-center" }}
          >
            App Bars
          </div>
          <div style={{ display: "flex", justifyContent: "flex-end" }}>
            <IconCircleXFilled />
          </div>
        </Container>
        <Stack m="xs" bg="var(--mantine-color-white)">
          <Flex mih={50} gap="md" justify="space-between" align="center">
            <div style={{ flex: 1 }}>
              <IconAlignLeft style={{ marginLeft: "4px" }} />
            </div>

            <div
              style={{
                display: "flex",
                alignItems: "center",
                gap: "md",
                marginRight: "4px",
              }}
            >
              <IconSearch />
              <Avatar
                variant="filled"
                radius="sm"
                src="https://images.unsplash.com/photo-1535713875002-d1d0cf377fde?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=250&q=80"
              />
            </div>
          </Flex>
        </Stack>

        <Stack m="xs" bg="var(--mantine-color-white)">
          <Flex mih={50} gap="md" justify="space-between" align="center">
            <div style={{ flex: 1 }}>
              <IconAlignLeft style={{ marginLeft: "4px" }} />
            </div>

            <div style={{ display: "flex", alignItems: "center", gap: "md" }}>
              <Autocomplete radius="lg" placeholder="Seach Product" />
            </div>

            <div
              style={{
                display: "flex",
                alignItems: "center",
                gap: "md",
                marginRight: "4px",
              }}
            >
              <Avatar color="white" radius="xl">
                <IconBell />
              </Avatar>
            </div>
          </Flex>
        </Stack>

        <Stack m="xs" bg="var(--mantine-color-white)">
          <Flex mih={50} gap="md" justify="space-between" align="center">
            <div style={{ flex: 1 }}>
              <IconAlignLeft style={{ marginLeft: "4px" }} />
            </div>
            <div style={{ display: "flex", alignItems: "center", gap: "md" }}>
              <Autocomplete radius="lg" placeholder="Seach Product" />
            </div>
            <div
              style={{
                display: "flex",
                alignItems: "center",
                gap: "md",
                marginRight: "4px",
              }}
            >
              <Avatar color="white" radius="xl">
                <IconBell />
              </Avatar>
            </div>
          </Flex>
        </Stack>
      </Box>
    </div>
  );
};

export default AppBar;
